css:
@-moz-document domain(mumkeyjones.tv)
{

#masthead{
  background-color: #111 !important; 
  border-top: none;
}

#masthead li{
  background-color: #111 !important; 
}

.menu-item a{
  color: white !important;
}

.entry-meta *{
  color: white !important;
}

.menu-item .sub-menu {
  background-color: #111 !important;
}

.menu-item .sub-menu li a:hover {
  background-color: #333 !important;
}

#searchform input, .search-field{
  background-color: #333;;
  border: 1px solid #0c9e86 !important;
  color: white;
}

.recent-content, #content{
  background-color: #111 !important;
  color: white !important;
}

.entry-overview{
  background-color: #333;
}

.entry-title a{
  color: white !important;
}

.thumbnail-wrap img{
  border-radius: 0px !important;
}

body{
  background-image: url("https://i.imgur.com/K9PN2Qh.png");
}

.widget *{
  color: white !important;
}

}
